fn generate_integers(a: i32, b: i32) -> Vec<i32> {
    let mut result: Vec<i32> = vec![];
    let mut i: i32 = a;
    let mut j: i32 = b;
    while i <= j {
        if i % 2 == 0 {
            result.push(i);
        }
        i += 1;
    }
    return result;
}

